import { useState } from 'react';
import React from 'react';

function AuthForm() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [retypePassword, setRetypePassword] = useState('');
  const [isLogin, setIsLogin] = useState(true);
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  function handleSubmit(event) {
    event.preventDefault();

    if (isLogin) {
      // Perform login validation and set isLoggedIn state variable if successful
    } else {
      // Perform registration validation and create new account if successful
    }
  }

  function handleLoginClick() {
    setIsLogin(true);
  }

  function handleRegisterClick() {
    setIsLogin(false);
  }

  return (
    <>
      {isLoggedIn ? (
        <div>You are logged in.</div>
      ) : (
        <form onSubmit={handleSubmit}>
          <label>
            Username:
            <input
              type="text"
              value={username}
              onChange={(event) => setUsername(event.target.value)}
            />
          </label>
          <label>
            Password:
            <input
              type="password"
              value={password}
              onChange={(event) => setPassword(event.target.value)}
            />
          </label>
          {!isLogin && (
            <label>
              Retype password:
              <input
                type="password"
                value={retypePassword}
                onChange={(event) => setRetypePassword(event.target.value)}
              />
            </label>
          )}
          <button type="submit">{isLogin ? 'Log in' : 'Register'}</button>
          <button type="button" onClick={isLogin ? handleRegisterClick : handleLoginClick}>
            {isLogin ? 'Create new account' : 'Log in with existing account'}
          </button>
        </form>
      )}
    </>
  );
}
export default isLogin;
